def transform(sequence):
    count_zero = 0
    for i in range(len(sequence)):
        if sequence[i] == '0':
            count_zero += 1
        else:
            break
    return '0'*count_zero + sequence[count_zero:].replace('0', 'X').replace('1', '0').replace('X', '1') + '0'*count_zero

def transform(sequence):
    first_nonzero = next((i for i, x in enumerate(sequence) if x != "0"), None)
    last_nonzero = next((i for i, x in enumerate(sequence[::-1]) if x != "0"), None)
    last_nonzero = len(sequence) - last_nonzero - 1 if last_nonzero is not None else None
    return "0" * first_nonzero + sequence[first_nonzero:last_nonzero] + "0" * (len(sequence) - last_nonzero)

